import React from 'react';
import axios from 'axios'
let soldiers;
class Stable extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            kind: '',
            data: []
        };
    }
    componentDidMount(){
        axios
            .get('http://127.0.0.1:7001/soldier/all')
            .then(({ data })=> {
                this.setState({
                    data: data
                });
            })
            .catch((err)=> {})
    }

    render() {
        const child = this.state.data.map((el, index) => {
            return <div key={index}>
                <p>Title - { el.data.first_name }</p>
                <p>Author - { el.data.first_name }</p>
            </div>
        });

        return <div>
            <div>{ child }</div>
        </div>;
    }
}

export default Stable;
